import React from 'react';
import './App.css';

export interface MyProps {}

export interface MyState {
    nama: string;
    kelas: string;
    pagiSiang: string;
}

export interface MyButton {
    numButton: number;
}

export class Component1 extends React.Component <{}, MyState>  {
    constructor({}) {
        super({});

        this.state = {
            nama: "JOJO",
            kelas: "XI MIPA 2",
            pagiSiang: "true"
        };
    }

    render() {
        return (
            <div>
                <h1>Nama : {this.state.nama}</h1>
                <p>Kelas : {this.state.kelas}</p>
                <p>Pagisiang : {this.state.pagiSiang}</p>
            </div>
        )
    }
}
export default Component1;
